Defendant Jaquay A Hudnall in court with attorney Darryl E Smith.  Janet Claire Protasiewicz appeared for the State of Wisconsin.
- AMENDED INFORMATION, FILED.
COUNT 1 AMENDED to Operating A Motor Vehicle Without Owner's Consent - PTAC, As A Party To A Crime, contrary to 943.23(3), 939.50(3)(i),, 939.05, Wisconsin Stats, a CLASS I FELONY.

AS TO AMENDED COUNT 1, Defendant changes plea to GUILTY. Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived his rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. Defendant is advised he is a convicted felon and may not possess any firearms. Defendant is advised he is unable to vote in any election until civil rights are restored. Defendant further advised that if he is not a US citizen deportation is possible.  

Sentencing proceeds. No corrections made to PSI report. Statements made by the State and defense counsel.
Court sentenced defendant to serve a term of IMPRISONMENT in the Wisconsin State Prisons for 3 YEARS and 6 MONTHS.  INITIAL CONFINEMENT of 1 YEAR and 6 MONTHS and EXTENDED SUPERVISION of 2 YEARS. Credit given for 4 days time served if revoked.  25% of prison funds, collected by Department of Corrections, to go toward all court ordered monetary obligations, with restitution having first priority, all other monetary obligations thereafter, if revoked.
.
COURT STAYS sentence and places defendant on PROBATION for 2 YEARS.
.
CONDITIONS OF PROBATION/EXTENDED SUPERVISION: 
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-maintain sobriety, no alcohol, no drugs;
-obtain/maintain full time employment/education/vocation;
-random urine screens; if deemed appropriate;
-pay restitution in the amount of $85.00 to Judith U.; failure to pay shall result in a civil judgment being entered;
-provide a DNA sample;
-pay MANDATORY DNA surcharge; failure to pay shall result in a civil judgment being entered;
-pay all court costs, fees, and surcharges; failure to pay shall result in a civil judgment being entered;
-pay all applicable fees of supervision;  failure to pay shall result in a civil judgment being entered;
-no contact with victim, Judith U.
-
-  A payment plan for all monetary obligations is to be established by Department of Corrections, Probation and Parole.  All unpaid monetary balances at the end of said period will convert to a civil judgment.
-  No Cash Bail was posted in this matter.
-  Firearm/Voting Rights/Civil Judgment Warnings given.
.
Court advised defendant on Extended Confinement or "bad time".
Defendant IS eligible for Challenge Incarceration Program.
Defendant IS eligible for the Wisconsin Substance Abuse Program.
Appeal rights given. Written Explanation of Determinate Sentence and Notice of Right to Seek Postconviction Relief received and filed. Acknowledgment of ineligibility  Copies given to defendant
